import React from "react";

import "./ResumePage.css";
import ContentHeading from "../../shared/Heading/ContentHeading";
import Container from "../../shared/components/Container";
import ResumeSection from "../components/ResumeSection";
import PhotoCard from "../../about/components/PhotoCard";
import myPhoto from "../../images/myPicture.jpg";

const ResumePage = () => {
    return (
        <React.Fragment>
            <ContentHeading className="heading-container">
                Resume
            </ContentHeading>
            <Container className="resume-container">
                <ResumeSection>
                    <PhotoCard containerClassName="" imageClassName="resume-photo" src={myPhoto} alt="Denis Ladychenko photo"></PhotoCard>
                </ResumeSection>
            </Container>
        </React.Fragment>
    );
};

export default ResumePage;
